import base64
import io
import struct


base64_string=""
base64_string2=""
def wav_format(base64_string):
    wav_data = base64.b64decode(base64_string)

    # WAV 
    riff, file_size, wave = struct.unpack('<4sI4s', wav_data[:12])
    fmt, fmt_length = struct.unpack('<4sI', wav_data[12:20])

    # 
    if riff != b'RIFF' or wave != b'WAVE' or fmt != b'fmt ':
        print("Not a valid WAV file")


    # 
    audio_format, channels, sample_rate, byte_rate, block_align, bits_per_sample = struct.unpack('<HHIIHH',
                                                                                                 wav_data[20:36])

    # 
    is_mono = channels == 1

    #  16-bit 
    is_16bit = bits_per_sample == 16

    print(f"sample_rate:{sample_rate},byte_rate:{byte_rate},block_align:{block_align}")

    print(f"Channels: {channels}, Bits per sample: {bits_per_sample}")

def print_wav_header(base64_str):
    try:
        #  base64 
        audio_chunk = base64.b64decode(base64_str)
    except Exception as e:
        print(f"base64 : {e}")
        return

    audio_file = io.BytesIO(audio_chunk)
    audio_file.seek(0)
    wav_data = audio_file.read(44)

    if len(wav_data) < 44:
        print("WAV ")
        return

    #  WAV 
    riff, file_size, wave, fmt, fmt_length, audio_format, num_channels, sample_rate, byte_rate, block_align, bits_per_sample, data, data_size = struct.unpack('<4sI4s4sIHHIIHH4sI', wav_data)

    # 
    print(f"RIFF: {riff}")
    print(f"File Size: {file_size}")
    print(f"WAVE: {wave}")
    print(f"fmt: {fmt}")
    print(f"fmt Length: {fmt_length}")
    print(f"Audio Format: {audio_format}")
    print(f"Num Channels: {num_channels}")
    print(f"Sample Rate: {sample_rate}")
    print(f"Byte Rate: {byte_rate}")
    print(f"Block Align: {block_align}")
    print(f"Bits Per Sample: {bits_per_sample}")
    print(f"data: {data}")
    print(f"Data Size: {data_size}")

    # 
    if riff != b'RIFF' or wave != b'WAVE' or fmt != b'fmt ' or data != b'data':
        print(" WAV ")
    else:
        print(" WAV ")

def check_wav_file_size(base64_string):
    # 1. Base64
    decoded_bytes = base64.b64decode(base64_string)

    # 2. WAV (12)
    wav_header = decoded_bytes[:12]

    # 3.  (little-endian, 4)
    file_size_bytes = wav_header[4:8]

    # 4. 
    file_size_dec = struct.unpack('<I', file_size_bytes)[0]

    # 5. 
    actual_size = len(decoded_bytes)
    if file_size_dec == actual_size:
        print("")
    else:
        print(f"={file_size_dec}={actual_size}")

wav_format(base64_string)
wav_format(base64_string2)
print_wav_header(base64_string)
print_wav_header(base64_string2)
check_wav_file_size(base64_string)
check_wav_file_size(base64_string2)
def check_base64_chars(base64_string):
    # Base64
    valid_chars = set('ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=')
    
    # 
    invalid_chars = []
    for i, char in enumerate(base64_string):
        if char not in valid_chars:
            invalid_chars.append((i, char))
    
    # 
    if invalid_chars:
        print("Base64:")
        for pos, char in invalid_chars:
            print(f" {pos}: '{char}'")
        return False
    else:
        print("Base64")
        return True

# 
print("base64:")
check_base64_chars(base64_string)

print("\nbase64:")
check_base64_chars(base64_string2)